import React from 'react';
import '../contact-us/contact-us.css';
import Navbar from './component/navbar/navbar';
import Footer from './component/footer/footer';


function Contactus() {
  return (
      <>
      <Navbar />
      <Footer />
      </>
  );
}

export default Contactus;
